import cashappIcon from '@iconify/icons-cib/cashapp';
// import venmoIcon from '@iconify/icons-cib/venmo';
import logoVenmo from '@iconify/icons-ion/logo-venmo';
import "./style.css";

// npm install --save-dev @iconify/react @iconify/icons-ion
